import React from 'react';
import './Scouting.css';
import Position from '../../img/Position/Top.png';
import imageRank from '../../img/Rank/Season_2019_-_Gold_3.png';


class Scouting extends React.Component {

    constructor (props){
        super(props);
    }

    render() {
        return(
            <div id="Scouting">
                <h1>SCOUTING</h1>
                <div id="border">
                    <div id="SummonerName">
                        {this.props.summonerName}
                    </div>
                    <div id="positionRank">
                        <img src={this.props.imgMainPosition} id="PosImg"/>
                        <img src={this.props.rank.imgRank} id="RankImg"/>
                        <div id="textRank">
                            <div id="rankName">{this.props.rank.rankName}</div>
                            <div id="LP">{this.props.rank.LP} LP</div>
                            <div id="winLose">
                                {this.props.rank.win}W {this.props.rank.lose}L 
                                <div id="winrate">
                                    {this.props.rank.winrate}%
                                </div>
                            </div>
                        </div>
                    </div>
                    <div id="mostValuableRank">

                    </div>
                </div>
            </div>
        );
    }
}

Scouting.defaultProps = {
    summonerName: 'Martinounux',
    imgMainPosition: Position,
    
};


export default Scouting;
